        font-size: 16px;
        line-height: 20px;

        color: $white !important;
        text-align: center;
        border: none;

        background: linear-gradient(135deg, #FF4E16 0%, #FF5A13 45.83%, #FFB90F 100%);
        box-shadow: 0 0 20px rgba(255, 185, 15, 0.2);
    }

    &--empty {
        cursor: pointer;
        margin-top: auto;

        display: flex;
        align-items: center;
        justify-content: center;

        font-weight: bold;
        font-size: 16px;
        line-height: 20px;

        width: 100%;
        padding: 12px 0;
        transition: .3s 0s;

        text-align: center;
        border: 1px solid $orange1;
        filter: drop-shadow(0px 0px 20px rgba(255, 185, 15, 0.2));

        &:hover {
            color: $white1;
            background: $orange1;
        }
    }

    &--h48 {
        height: 48px;
    }
}

.input {
    box-sizing: border-box;

    border: 1px solid;
    background: transparent;

    padding: 0 10px;

    outline: none;
    height: 40px;

    &--textarea {
        padding: 13px 16px;

        width: 100%;
        resize: none;
    }

    &--p {

        &16 {
            width: 100%;
            padding: 0 16px;
        }
    }

    &--h {

        &48 {
            height: 48px;
        }

        &115 {
            height: 115px;
        }

        &130 {
            height: 130px;
        }
    }

    option {
        color: $black;
    }
}

.as-tooltip {
    $parent: &;
    $heading: 160px;
    $icon: 24px;
    position: relative;

    &__icon {
        color: $dark5;
        background: $dark4;

        display: flex;
        align-items: center;
        justify-content: center;

        width: $icon;
        height: $icon;
        cursor: pointer;

        border-radius: 50%;
        font-weight: bold;
        font-size: 16px;
        line-height: 22px;
    }

    &__body {
        visibility: hidden;
        width: $heading;

        background: $dark4;
        color: $dark5;

        text-align: center;
        border-radius: 6px;
        padding: 5px 10px;

        z-index: 1;
        position: absolute;
        transition: .3s 0s;

        opacity: 0;
        bottom: 20%;
        left: -(($heading / 2) - ($icon / 2));
    }

    &:hover {

        #{$parent} {

            &__body {
                opacity: 1;
                visibility: visible;
                bottom: calc(100% + 4px);
            }
        }
    }
}

@include dark {
    .input {
        color: $white;
        border-color: rgba(255, 255, 255, .1);
    }
}
@include white {
    .input {
        color: $black;
        border-color: rgba(0, 0, 0, .16);
    }
}

@include media-breakpoint-down(md) {
    .as-tooltip {
        $parent: &;

        &__body {
            right: calc(100% + 4px);
            left: auto;
        }

        &:hover {

            #{$parent} {

                &__body {
                    bottom: -50%;
                }
            }
        }
    }
}

