sources.sass\\component\\header.scss:
.header {
    position: relative;
    width: 100%;
    height: 88px;

    transition: .3s 0s;
    z-index: 10;

    &__container {
        height: 100%;
        display: flex;

        margin: 0 auto;
        max-width: 1440px;

        position: relative;
        z-index: 10;
    }

    &__logo {
        padding: 0 22px;

        display: flex;
        align-items: center;

        border-right: 1px solid;
    }

    &__body {
        width: 100%;

        display: flex;
        justify-content: space-between;
    }

    &__actions {
        display: flex;
        align-items: center;
        margin-left: auto;

        &-list {
            display: flex;
            align-items: center;
            margin-left: 10px;
            margin-right: 15px;
        }

        &-item {
            position: relative;
            cursor: pointer;
        }

        &-item + &-item {
            margin-left: 15px;
        }

        &-search {
            cursor: pointer;

            display: flex;
            align-items: center;

            margin: 0 26px;
        }

        &-shopping {
            position: relative;
            cursor: pointer;

            height: 100%;
            display: flex;
            align-items: center;

            padding: 0 26px;
            border-left: 1px solid;
        }

        &-menu {
            cursor: pointer;

            display: flex;
            align-items: flex-end;
            flex-direction: column;

            padding: 0 13px 0 0px;

            span {
                position: relative;
                width: 32px;
                height: 2px;

                margin: 6px 0;

                background: $orange1;
                transition: .3s 0s;

                &.small {
                    width: 16px;
                }
            }

            &.open {
                span {
                    &.first {
                        top: 7px;
                        transform: rotate(45deg);
                    }

                    &.last {
                        bottom: 7px;
                        transform: rotate(-45deg);
                    }

                    &.small {
                        display: none;
                    }
                }
            }
        }

        &-contact {
            position: relative;

            margin-right: 10px;
            margin-left: 25px;

            p {
                user-select: none;
                position: relative;
                cursor: pointer;

                font-weight: bold;
                font-size: 13px;
                line-height: 15px;

                &:after {
                    content: '';
                    display: block;
                    position: absolute;
                    bottom: -5px;

                    width: 17px;
                    height: 2px;

                    background: linear-gradient(135deg, #FF4E16 0%, #FF5A13 45.83%, #FFB90F 100%);
                }
            }
        }

        &-count {
            width: 16px;
            height: 16px;
            border-radius: 50px;
            font-size: 14px;
            color: $white;

            display: flex;
            align-items: center;
            justify-content: center;

            position: absolute;
            top: -2px;
            right: -2px;

            background: $orange1;
        }
    }

    &__contact {
        color: $white;
        width: 200px;
        background: linear-gradient(135deg, #FF4E16 0%, #FF5A13 45.83%, #FFB90F 100%);

        padding: 24px 0;
        right: -20px;

        align-items: center;
        flex-direction: column;

        position: absolute;
        display: none;

        &-group {
            font-size: 16px;
            font-family: Gilroy, sans-serif;

            & + & {
                margin-top: 24px;
            }
        }

        &-title {
            margin-bottom: 2px;
            font-weight: bold;

            line-height: 20px;
        }

        &-value {
            line-height: 22px;
        }

        &-links {
            display: flex;
            margin-top: 24px;
        }

        &-link {
            margin-right: 8px;
        }

        &:after {
            content: '';
            display: block;

            position: absolute;

            bottom: 0;
            left: 0;

            width: 100%;
            height: 2px;
            background: #FFFFFF;
        }

        &.animation {
            display: flex;

            top: 0;
            opacity: 0;
            transition: .3s 0s;
        }

        &.active {
            display: flex;

            top: 50px;
            opacity: 1;
        }
    }

    &__theme {
        display: flex;

        &-item {
            user-select: none;
            padding: 5px 4px;
            cursor: pointer;

            font-weight: 500;
            font-size: 13px;
            line-height: 15px;

            &.active {
                color: $orange1;
                background: linear-gradient(135deg, rgba(255, 78, 22, 0.1) 0%, rgba(255, 90, 19, 0.1) 45.83%, rgba(255, 185, 15, 0.1) 100%);
            }

            & + & {
                margin-left: 4px;
            }
        }
    }

    &__search {
        position: absolute;
        top: -7px;
        right: -200px;

        display: flex;
        align-items: center;
        height: 40px;
        transition: .3s 0s;
        visibility: hidden;
        opacity: 0;

        &-input {
            width: 200px;
            background: $blue2;
        }

        &-btn {
            display: flex;
            align-items: center;

            width: 60px;
            height: 100%;

            border-left: none;
        }

        &--active {
            opacity: 1;
            visibility: visible;
            right: calc(100% - 23px);
        }
    }

    &--anim {
        position: fixed;
        top: -100%;
    }

    &--fixed {
        top: 0;
    }
}

@include dark {
    .header {
        color: $white;
        background: $dark1;

        &__logo {
            border-color: rgba(255, 255, 255, 0.1);

            #fox {
                fill: $white;
            }
        }

        &__actions {
            &-shopping {
                border-color: rgba(255, 255, 255, 0.1);
            }
        }
    }
}

@include white {
    .header {
        color: $black;
        background: $white1;

        &__logo {
            border-color: rgba(0, 0, 0, 0.1);


            #fox {
                fill: $black;
            }
        }

        &__actions {
            &-shopping {
                border-color: rgba(0, 0, 0, 0.1);
            }
        }
    }
}

// 1200
@include media-breakpoint-down(lg) {
    .header {
        height: 80px;

        &__logo {
            padding: 0 16px;
        }

        &__actions {

            &-search {
                margin: 0 20px;
            }

            &-shopping {
                padding: 0 20px;
            }

            &-contact {
                margin-right: 5px;
                margin-left: 20px;

                p {
                    font-size: 12px;
                }
            }
        }

        &__contact {

            &.active {
                top: 47px;
            }
        }

        &__theme {

            &-item {
                padding: 5px 4px;
                font-size: 12px;
            }

            &-dark {
                margin-right: 3px;
            }
        }
    }
}

@media screen and (min-width: 1130px) {
    .header {

        &__actions {

            &-menu {
                display: none;
            }
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .header {
        height: 70px;

        &__logo {
            padding: 0 20px;
            border-right: none;
        }

        &__contact {

            &.active {
                top: 42px;
            }
        }

        &__actions {

            &-search {
                margin: 0 16px;
            }

            &-shopping {
                padding: 0 16px;
                border-left: none;
            }

            &-contact {
                margin-left: 16px;

                p {
                    font-size: 12px;
                }
            }

            &-item.mdisable {
                display: none;
            }
        }

        &__contact {
            width: 180px;
            padding: 0 20px 20px 20px;

            &-group {
                margin: 20px 0;
                font-size: 15px;
            }

            &-title {
                margin-bottom: 2px;
                line-height: 16px;
            }

            &-value {
                line-height: 18px;
            }
        }
    }
}

// 768
@include media-breakpoint-down(sm) {
    .header {
        border-bottom: 1px solid;

        &__logo {
            padding: 0 15px;
        }

        &__actions {

            &-search {
                margin: 0 7px;
            }

            &-shopping {
                padding: 0 7px;
                border-left: none;
            }

            &-contact {
                margin-left: 7px;

                p {
                    padding: 5px 7px;
                    border: 2px solid $orange1;

                    &:after {
                        content: '';
                        display: none;
                    }
                }
            }

            &-menu {
                padding: 0 6px 0 13px;
            }
        }
    }
}

@include dark {
    // 768
    @include media-breakpoint-down(md) {
        .header {
            border-bottom-color: rgba(255, 255, 255, 0.1);;
        }
    }
}

@include white {
    // 768
    @include media-breakpoint-down(md) {
        .header {
            border-bottom-color: rgba(0, 0, 0, 0.16);;
        }
    }
}

// 576
@media screen and (max-width: 576px) {
    .header {

        &__logo {
            padding: 0 6px;
        }

        &__theme {
            display: none;
        }

        &__actions {

            &-search {
                margin: 0 7px;
            }

            &-shopping {
                padding: 0 7px;
                border-left: none;
            }

            &-contact {
                margin-left: 7px;
            }

            &-menu {
                padding: 0 6px 0 13px;
            }
        }
    }
}

