        margin-left: 6px;

        display: flex;
        align-items: center;
        justify-content: center;

        width: 20px;
        height: 15px;

        border-radius: 3px;
        border-bottom-left-radius: 0;

        background: linear-gradient(135deg, rgba(#FF4E16, .3) 0%, rgba(#FF5A13, .3) 45.83%, rgba(#FFB90F, .3) 100%);

