        }

        &-value + &-value {
            margin-top: 8px;
        }
    }

    &__action {
        width: 100%;
        position: absolute;

        z-index: 2;
        left: 0;

        opacity: 0;
        visibility: hidden;
        bottom: 0;

        transition: .3s 0s;
    }

    &:hover {
        background: $blue3;

        #{$cart} {
            &__image {
                margin-top: 0;
            }

            &__info {

                &-rate {
                    height: 16px;
                }
            }

            &__action {
                visibility: visible;
                opacity: 1;
                bottom: -42px;
            }
        }
    }
}

@include dark {
    .cart {

        &:hover {
            background: $blue3;
        }
    }
}
@include white {
    .cart {

        &:hover {
            background: $white;
            box-shadow: 0 6px 60px -24px rgba(0, 0, 0, 0.75);
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .cart {
        $cart: &;
        border: 1px solid;

        &__info {
            margin: 0 16px;

            &-rate {
                display: none;
            }

            &-list {
                display: none;
            }
        }

        &__action {
            position: relative;

            opacity: 1;
            visibility: visible;
            bottom: 0;
            margin: 5px 0 15px;
            padding: 0 10px;
        }

        &:hover {

            #{$cart} {
                &__image {
                    margin-top: 16px;
                }

                &__info {

                    &-rate {
