                    }
                }

                &__action {
                    visibility: visible;
                    opacity: 1;
                    bottom: 0;
                }
            }
        }
    }

    @include dark {
        .cart {
            border-color: rgba(255, 255, 255, 0.1);
        }
    }

    @include white {
        .cart {
            border-color: rgba(255, 255, 255, 0.16);
        }
    }
