.editor {

    blockquote {
        padding-left: 16px;
        margin: 32px 0;

        font-size: 24px;
        line-height: 32px;

        border-left: 2px solid $orange1;
    }

    h1 {
        font-weight: bold;
        font-size: 52px;
        line-height: 64px;

        margin-bottom: 20px;
    }

    h2 {
        font-weight: bold;
        font-size: 32px;
        line-height: 40px;

        margin-bottom: 18px;
    }

    h3 {
        font-weight: bold;
        font-size: 28px;
        line-height: 34px;

        margin-bottom: 16px;
    }

    h4 {
        font-weight: bold;
        font-size: 24px;
        line-height: 32px;

        margin-bottom: 14px;
    }

    h5 {
        font-weight: bold;
        font-size: 20px;
        line-height: 24px;

        margin-bottom: 10px;
    }

    h6 {
        font-weight: bold;
        font-size: 16px;
        line-height: 22px;

        margin-bottom: 6px;
    }

    p {
        font-size: 16px;
        line-height: 22px;
        margin: 14px 0;

        b {
            font-weight: bold;
        }

        i {
            font-style: italic;
        }

        span {
            opacity: .5;
        }

        a {
            color: $orange1 !important;
        }

        &.tbborder {
            padding: 16px 0;
            border-top: 1px solid;
            border-bottom: 1px solid;
        }
    }

    hr {
        margin: 40px 0;
    }

    ul {
        margin: 20px 0 15px;
        counter-reset: couner;

        li {
            display: flex;
            align-items: flex-start;
            counter-increment: couner;
            margin-top: 5px;

            &::before {
                content: counter(couner);

                min-width: 32px;
                min-height: 32px;

                margin-top: -5px;
                border-radius: 50%;
                border: 1px solid $orange1;

                display: flex;
                align-items: center;
                justify-content: center;

                margin-right: 8px;
            }
        }

        li + li {
            margin-top: 24px;
        }
    }

    ol {
        margin-top: 10px;
        font-size: 16px;
        line-height: 22px;

        li {
            display: flex;
            align-items: flex-start;

            &::before {
                content: '';
                margin: 8px 5px;

                min-width: 5px;
                min-height: 5px;

                border-radius: 50%;
                background: $orange1;
            }
        }

        li + li {
            margin-top: 4px;
        }
    }

    .image {
        display: flex;
        align-items: center;
        margin-top: 24px;

        &__img {
            margin-right: 16px;
        }
    }

    .lists {
        display: flex;
        align-items: center;

        &__list {
            margin-right: 16px;

            &--left {
                color: $orange1;
            }
        }

        & > ul {

            li {

                &::before {
                    display: none;
                }
            }
        }
    }

    .list--3 {
        display: grid;
        grid-template-rows: 1fr 1fr 1fr;
        grid-auto-flow: column;
        width: 50%;

        li {
            margin-top: 25px;
        }
    }
}

@include dark {
    .editor {
        color: $white;

        hr {
            border-color: rgba(255, 255, 255, 0.1);
        }

        p {

            &.tbborder {
                border-color: rgba(255, 255, 255, 0.1);
            }
        }
    }
}

@include white {
    .editor {
        color: $black;

        hr {
            border-color: rgba(0, 0, 0, 0.16);
        }

        p {

            &.tbborder {
                border-color: rgba(0, 0, 0, 0.16);
            }
        }
    }
}

// 1200
@include media-breakpoint-down(lg) {
    .editor {

        blockquote {
            padding-left: 16px;
            margin: 26px 0;

            font-size: 22px;
            line-height: 30px;
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .editor {

        h1 {
            font-size: 48px;
            line-height: 58px;
            margin-bottom: 18px;
        }

        h2 {
            font-size: 30px;
            line-height: 38px;
            margin-bottom: 16px;
        }

        h3 {
            font-size: 26px;
            line-height: 32px;
            margin-bottom: 14px;
        }

        h4 {
            font-size: 22px;
            line-height: 30px;
            margin-bottom: 14px;
        }

        h5 {
            font-size: 20px;
            line-height: 23px;
            margin-bottom: 10px;
        }

        p {
            margin-top: 10px;
        }

        ul {
            margin: 15px 0 10px;

            li {
                margin-top: 5px;

                &::before {
                    min-width: 32px;
                    min-height: 32px;

                    margin-top: -5px;
                    margin-right: 6px;
                }
            }

            li + li {
                margin-top: 20px;
            }
        }

        blockquote {
            padding-left: 14px;
            margin: 22px 0;

            font-size: 20px;
            line-height: 28px;
        }

        .image {
            flex-direction: column;
            align-items: flex-start;

            &__img {
                margin-right: 0;
            }
        }

        .list--3 {
            width: 100%;

            li {
                margin-top: 20px;
            }
        }
    }
}

// 768
@include media-breakpoint-down(sm) {
    .editor {

        h1 {
            font-size: 42px;
            line-height: 50px;
            margin-bottom: 16px;
        }

        h2 {
            font-size: 28px;
            line-height: 36px;
            margin-bottom: 14px;
        }

        h3 {
            font-size: 24px;
            line-height: 30px;
            margin-bottom: 12px;
        }

        h4 {
            font-size: 20px;
            line-height: 28px;
            margin-bottom: 12px;
        }

        h5 {
            font-size: 18px;
            line-height: 21px;
        }

        ul {
            margin: 12px 0 8px;

            li {
                margin-top: 4px;

                &::before {
                    min-width: 28px;
                    min-height: 28px;

                    margin-top: -4px;
                    margin-right: 4px;
                }
            }

            li + li {
                margin-top: 15px;
            }
        }

        blockquote {
            padding-left: 12px;
            margin: 20px 0;

            font-size: 18px;
            line-height: 26px;
        }

        .lists {
            position: relative;
            flex-direction: column;
            align-items: flex-start;
            margin-bottom: 30px;

            li + li {
                margin-top: 35px;
            }

            &__list {
                $list: &;
                margin-right: 0;

                &--left {
                    position: absolute;
                    top: 25px;
                    left: 0;
                }
            }
        }
    }
}

// 576
@media screen and (max-width: 576px) {
    .editor {

        blockquote {
            padding-left: 10px;
            margin: 16px 0;

            font-size: 16px;
            line-height: 22px;
        }
    }
}

sources.sass\\component\\catalog.scss:
.catalog {
    transition: .3s 0s;
    border-top: 1px solid;
    border-bottom: 1px solid;

    &__container {
        margin: 0 auto;
        max-width: 1308px;
        width: 100%;

        display: flex;
        flex-direction: column;

        border-left: 1px solid;
        border-right: 1px solid;
    }

    &__body {
        display: flex;

        &-header {
            display: none;
            margin: 0 -16px 32px;
            padding: 24px 16px;

            align-items: center;
            justify-content: space-between;

            border-bottom: 1px solid;
        }

        &-title {
            display: flex;
            align-items: center;
            font-size: 22px;
            line-height: 28px;

            img {
                margin-right: 4px;
            }
        }

        &-close {
            cursor: pointer;

            display: flex;
            align-items: center;
            justify-content: center;

            span {
                position: relative;

                display: block;
                width: 32px;
                height: 4px;
                background: $white1;

                &:first-child {
                    left: 16px;
                    transform: rotate(45deg);
                }

                &:last-child {
                    right: 16px;
                    transform: rotate(-45deg);
                }
            }
        }

        &-sidebar {
            padding: 32px 16px;

            flex: 0 0 260px;
            border-right: 1px solid;
        }

        &-list {
            flex: 1;
            display: grid;
            grid-template-columns: repeat(4, 1fr);
        }
    }

    &__header {
        height: 72px;
        border-bottom: 1px solid;

        display: flex;
        align-items: center;
        justify-content: flex-end;

        padding: 0 17px;

        &-filter {
            display: none;

            font-family: Gilroy, sans-serif;
            font-size: 16px;
            line-height: 22px;
            padding: 10px 8px;
        }

        &-icon {
            margin-right: 5px;
        }
    }

    &__footer {
        height: 72px;
        border-top: 1px solid;

        display: flex;
        align-items: center;
        justify-content: flex-end;

        padding: 0 17px;
    }
}

@include dark {
    .catalog {
        color: $white;
        background: $dark1;
        border-color: rgba(255, 255, 255, 0.1);

        &__body {

            &-header,
            &-sidebar {
                border-color: rgba(255, 255, 255, 0.1);
            }
        }

        &__footer,
        &__header,
        &__container {
            border-color: rgba(255, 255, 255, 0.1);
        }
    }
}
@include white {
    .catalog {
        color: $black;
        background: $white1;
        border-color: rgba(0, 0, 0, 0.16);

        &__body {

            &-header,
            &-sidebar {
                border-color: rgba(0, 0, 0, 0.16);
            }
        }

        &__footer,
        &__header,
        &__container {
            border-color: rgba(0, 0, 0, 0.16);
        }
    }
}

// 1200
@include media-breakpoint-down(lg) {
    .catalog {

        &__container {
            margin: 0 20px;
            width: auto;
        }
    }
}

// 992
@include media-breakpoint-down(md) {
    .catalog {

        &__container {
            margin: 0 15px;
        }

        &__body {
            display: flex;

            &-header {
                display: flex;
            }

            &-sidebar {
                padding: 0 16px 32px;
                border-right: none;

                position: fixed;
                z-index: 999;

                top: -400px;
                left: 0;
                opacity: 0;
                visibility: hidden;

                transition: .3s 0s;
                min-width: 100vw;
                min-height: 100vh;

                &.open {
                    top: 0;
                    opacity: 1;
                    visibility: visible;
                }
            }

            &-list {
                grid-template-columns: repeat(3, 1fr);
            }
        }

        &__header {
            height: auto;
            border-bottom: 1px solid;

            display: flex;
            align-items: center;
            justify-content: space-between;

            padding: 16px 20px;

            &-filter {
                display: flex;
            }
        }

        &__footer {
            height: auto;
            padding: 16px 20px;
        }
    }

    @include dark {
        .catalog {

            &__body {

                &-sidebar {
                    background: $dark1;
                }
            }
        }
    }
    @include white {
        .catalog {

            &__body {

                &-sidebar {
                    background: $white1;
                }
            }
        }
    }
}

// 768
@include media-breakpoint-down(sm) {
    .catalog {

        &__container {
            margin: 0 10px;
        }

        &__body {

            &-header {
                margin: 0 -12px 16px;
                padding: 16px 12px;
            }

            &-title {
                font-size: 16px;
                line-height: 22px;
            }

            &-sidebar {
                padding: 0 12px 32px;
            }

            &-list {
                grid-template-columns: repeat(2, 1fr);
            }
        }

        &__pagination {
            width: 100%;
        }

        &__header {
            flex-direction: column;
            align-items: flex-start;

            padding: 14px 16px;

            &-filter {
                padding: 10px 8px;
                margin-bottom: 8px;
            }

            &-icon {
                margin-right: 2px;
            }

            .pagination {
                width: 100%;
                justify-content: space-between;
            }
        }

        &__footer {
            padding: 16px 20px;

            .pagination {
                width: 100%;
                justify-content: space-between;
            }
        }
    }
}

// 576
@media screen and (max-width: 576px) {
    .catalog {

        &__body {

            &-header {
                margin: 0 -8px 12px;
                padding: 12px 8px;
            }

            &-sidebar {
                padding: 0 8px 20px;
            }

            &-list {
                grid-template-columns: repeat(1, 1fr);
            }
        }

        &__header {
            padding: 12px 8px;

            &-filter {
                padding: 8px 6px;
                margin-bottom: 10px;
            }
        }

        &__footer {
            padding: 12px 8px;
        }
    }
}

